import React from "react";
import "./App.css";
import MainNavber from "./navbar";
import HelloApp from "./HelloApp";
import { Button } from "react-bootstrap";
import { ButtonToolbar } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <MainNavber />
      <HelloApp />
      <Button variant="d">Secondary</Button>
    </div>
  );
}

export default App;
